import "./AddSpotform.css";
const AddSpotForm = ({ addSpot }) => {
  return (
    <div className="modalBackgroundAdd">
      <div className="modalContainerAdd">
        <div className="titleAdd">
          <h1>Add a new spot</h1>
        </div>
        <div className="bodyAdd">
          <p>Name</p>
          <input type="text" placeholder="Location name" />
          <p>Country</p>
          <input type="text" placeholder="Country where is located" />
          <p>When to go</p>
        </div>
        <button
          onClick={() => {
            addSpot(false);
          }}
        >
          Add
        </button>
        <button
          onClick={() => {
            addSpot(false);
          }}
        >
          Close
        </button>
      </div>
    </div>
  );
};

export default AddSpotForm;
